Prototype 2 is an open world action-adventure video game, released for consoles on April 24, 2012. Developed by Canadian studio Radical Entertainment and published by Activision, it is the sequel to 2009's Prototype. The game was announced at the 2010 Spike VGA Awards with the tagline &quot;Murder your Maker.&quot;[5]
